INSERT INTO `qb_reply` VALUES ('701','','0','700','52','1','0','<p>&nbsp;&nbsp;&nbsp;&nbsp;四列圆柱滚子轴承是主要的轧辊轴承之一，其结构紧凑，刚性好，径向承载能力高，但不能承受轴向载荷。由于内圈无挡边，所以可分别安装内圈和外圈组件（带全套滚子和保持架），轴承的清洗、检查和拆卸均很方便。&nbsp;四列圆柱滚子轴承特别适用于要求高速和高精度的轧辊，如线材轧机，型材轧机和薄板冷热轧机、开坯机等的支承。<br /></p><p><a href=\"http://www.sbi.com.cn/userfiles/FC.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:154px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/FC.JPG\" width=\"160\" height=\"154\" /></a><a href=\"http://www.sbi.com.cn/userfiles/FCD.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:152px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/FCD.JPG\" width=\"160\" height=\"152\" /></a><a href=\"http://www.sbi.com.cn/userfiles/SFC.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:155px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/SFC.JPG\" width=\"160\" height=\"155\" /></a></p><table style=\"width:594px;border-collapse:collapse\" width=\"594\" height=\"608\"><colgroup><col width=\"79\" /><col width=\"60\" /><col width=\"30\" /><col width=\"31\" /><col width=\"25\" /><col width=\"30\" /><col width=\"42\" /><col width=\"39\" /><col width=\"41\" /><col width=\"52\" /><col width=\"65\" /><col width=\"100\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 3px solid;text-align:center;border-left:#c0c0c0 3px solid;font-style:normal;width:79px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 3px solid;font-weight:700;border-right:#c0c0c0 3px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"79\">型号</td><td style=\"border-bottom:#c0c0c0 3px solid;text-align:center;border-left:#c0c0c0 3px solid;font-style:normal;width:60px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 3px solid;font-weight:700;border-right:#c0c0c0 3px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"60\">原代号</td><td 